import numpy as np

def score(item, bins):
    if len(bins) == 0:
        return np.array([])

    bin_numbers = np.arange(1, len(bins) + 1)
    bin_capacity_ratios = bins / item
    bin_rest_capacity_ratios = bins / (bins - item)

    scores = (bins - item) / np.sqrt(bin_numbers) + np.log(bin_rest_capacity_ratios) + bin_numbers * np.sqrt(bin_capacity_ratios)
    scores[bins == bins.max()] = -np.inf

    return scores
